startSSE & closeSSE 

kefir - a reactive programming library to handle the data stream from mindbands.js
{'device':'34:81:F4:0E:BC:BE'}
{'signal': 0-255}
{'attention': 0-100}
{'meditation': 0-100}
{'wave': int16}



export function closeSSE(){
    md.closeSSE();
}

export function receiveSSE(callback){
    var outS = kefir.zip([
      asProp('device'),
      asProp('signal'),
      asProp('meditation'),
      asProp('attention'),
    ]).map(toObj)
    //
    md.startSSE();
    //
    outS.onValue(x=>{
        //console.log(x);
        callback(x)
      }
    )
}

function toObj (objs) {
  return objs.reduce(function (acc,o) {
    var k  = Object.keys(o)[0]
    acc[k] = o[k]
    return acc
  }, {})
}

function prop (p) {
  return (v) => {
    var r = {}
    r[p]  = v
    return r
  }
}

function asProp (ev) {
  return kefir.fromEvents(md, ev).map(prop(ev))
}

